INSERT INTO review VALUES(372, 412, 5, 'I have to thank the amazon recommendation engine for suggesting the mysore sandal talc. I never knew mysore sandal brand had a talc! I had purchased mysore sandal soap few weeks back and perhaps due to this purchase amazon would have recommended this as well. Glad I clicked the suggestion and bought one of these! Its good bye to my existing Ponds Sandalwood talc !This review compares Mysore sandal talc vis-a-vis Ponds Sandalwood talcPros-1. The Fragrance is the first thing which hits you as soon as you open the bottle. Its smells pure authentic sandal wood than the perfumed ponds talc powder2. The mysore sandal talc allows you to decide the size of the hole you want to have on the bottle. Ponds one forces you to have 3 holes as soon as you want the top cover. I always hated this with the ponds talc. Ponds really wants you to use more than what you need!3. The fragrance last longer than the ponds sandalwood talc even though out the day! Believe it or not - you have to try one and be the judge!4. Some reviews talk about the powder not been finely powdered. Nothing like that - the powder is as fine as its with Ponds sandalwood talc. No more no less!5. The bottle is sealed with a hologram sticker - thats assurance of genuine product from mysore sandal!6. Somehow I like the press-fit top of the bottle to keep the fragrance intact in the bottle when not in use! Ponds bottle was a twist to close top which is not really a seal tight way of shutting close the bottle7. Last but not the least- mysore sandal talc is 50% cheaper than Ponds sandalwood - why on earth would I ever buy Ponds again?Cons-None that i spotted yet');
