INSERT INTO review VALUES(672, 244, 3, 'Although, it makes a very rich and creamy lather, it starts melting quickly if kept wet. I need to take it out of the bathroom and dry it for the next use as I want to save as much of it as possible because its costlier than other brands. But, it does a far better job than other brands and its organic. Im happy to have this soap in my skincare regimen as an adult who has a very sensitive skin prone to irritation. The best thing about this soap is it doesnt leave any residue, which Im surprised to see. Other brands leave a thin film which makes skin feel very slippery and smooth and I dont like that. I want my skin to feel naked, fresh and not stripped with moisture. Mamaearth soap as well as the mamaearth baby wash did an excellent job. :)');
