INSERT INTO review VALUES(1541, 143, 5, 'Himalaya babycare baby lotion is specially formulated to restore the skin’s natural beauty , Great product enriched with almond oil that restore skin’s moisture, olive oil which improves skin luster, and yashtimadhu and country mallow, which soothes the skin. It contains 100% herbal actives so perfect for babys skin. Highly recommend it.');
