INSERT INTO review VALUES(1542, 179, 4, 'Very Nice Product . It is very light weighted and quickly gets absorbed so that you dont feel  creamy when you get out using this. It gives a smooth feeling to our skin and will not irritated your skin at all. This product is a lotion and not a moisturizer so it is not a replaced for that this is baby lotion too. It works very well for your skin.As this is not an oily lotion which will not make you sweat even in hot summer It  smells  good and leaves skin smooth afterwards.  Even though this is a baby lotion people with very sensitive skin can also use this one as it is good for damaged skin too. After using for many months i can say it rebuilds your skin.Himalaya is now not using Paraben for Baby lotion so the lotion is safe than before. This lotion is not greesy at all. Please go for Original product as duplicates are out there.');
