INSERT INTO review VALUES(1553, 103, 5, 'Tata Tea Agni is good if youre looking for good less priced option of tea. This tea is not too strong youve to add some large qty to make tea strong. But looking at its price its best. The price is 200/kg which is the lowest in the market. Im using this for last 5 months. Recommended');
INSERT INTO continutvanzare VALUES(1553, 46, 307352, 6);
INSERT INTO continutvanzare VALUES(1553, 462, 9384, 5);
INSERT INTO review VALUES(1553, 462, 2, 'After blindly using this soap for *years* it suddenly struck me that there is zero cooling effect in this soap now and by now I mean 2-3 years.I started using cinthol cool 6-7 years ago as a kid when I used to think how awesome is this soap (with that tingling cooling after sensation) I felt that this soap is way underrated because of that and the signature smell of it. But now I have realised that the cooling part is ZERO. And the fragrance is bland and doesnt last long.Either this soap is fake because Ive been continuously ordering this soap online in saver pack of 4/5 soaps from Amazon (but the seller being a trusty one at that 🤔) or Godrej has changed the chemical composition of this soap.Either Godrej should bring a "stronger" version of cinthol cool soap or I should look for better alternatives because this soap isnt what it used to be once.');
