INSERT INTO review VALUES(1555, 163, 3, 'i Tried wagh bakri, red label, tata agni, vedaka gold tea, etc.. but this time i tried tata tea gold but it turns out to be an average tea.. if i compare this tea with wagh bakri and vedaka gold it doesnt give good colour and 1.5 times more tata tea gold required to get same color as of wagh bakri and vedaka gold.. so if you want good color strong tea use vedaka gold or wagh bakri because these tea gives good color compared to tata tea gold');
