INSERT INTO review VALUES(1706, 298, 5, 'As Civilisation came to a stick end, the remaining Survivors fought over the last piece of the famed Antiseptic, claimed to be effective against all manners of Germs that covered the world. Finally, only a handful remained to satiate the desire of those who would be quick enough to steal these. Was it then worth it, for one man, to serve his own self, to grab the last Dettol? Over those that truely needed it, like healers of the sick people, or seek the ire of hoarders, who wanted the Last Dettol at any cost? The answer is yes, for not only this Dettol is effective as an Antiseptic, but also smells nice.');
