INSERT INTO review VALUES(1708, 451, 4, 'I got a genuine product with a good packaging and safely handled.I have been using this band since 1 month. I didn’t face any issue with it’s battery life and performance. It has functionalities like distance, heart rate, Calorie, steps tracker Which are accurate and in time too. It displays only call And Whatsapp’s texts notifications ( I have connected my band to iphone so I have no idea if it performs differently when connected to Android smartphones). The battery life is almost 5 days if fully charged once! Sensors inside the watch work finely. This band helps to find the phone if lost. It tracks the sleep time as well which will be displayed on a phone. Hope this was helpful For you.');
