INSERT INTO review VALUES(2011, 389, 3, 'The product packaging was good. Inside the package, you get one 1500ml dettol liquid handwash.Now, there is one thing Im extremely upset about which is that the liquid seems diluted. Its like someone mixed water in it. It doesnt feel like dettol at all. Im not saying that it is fake or not but thats what I got. About the scent, its not very strong. Its value for money only if you get it at good discount. I got it for 188rs.Anyways, if you find this review "Helpful" please do let me know. Thank you.');
INSERT INTO vanzare VALUES(2012, 2, 33, TO_DATE('2018-07-06 08:31:47', 'YYYY-MM-DD HH24:MI:SS'), 2090640);
INSERT INTO continutvanzare VALUES(2012, 280, 261330, 8);
INSERT INTO review VALUES(2012, 280, 1, 'To start off, the safe arrived with a Low Battery message, meaning that before I could do anything else, I had to go and get new batteries for this brand new item. Once you get things in order, the safe works well and serves its purpose, however, the manual provided is obsolete, and the instructions do not match up with this product. There are no solutions posted online either. If you want to program the safe, you have to figure it out on your own. The customer service personnel were not helpful either and they kept trying to force me to get a technician to come to my house at the cost of Rs. 500 just to program the device, which completely defeats the purpose of online shopping. Dont fall for it. This is rather ridiculous for such a big brand like Godrej.In case anyone else needs to re-program their home code, here is what I was able to do. I hope it works for you too:1.) The instructions indicate to press 68#, but it actually means 68(Lock). If the instructions indicate *, try pressing Clear2.) Every time I pressed 68#, I got an error message, so I had to go through all the steps listed below.3.) Before you can change personal code in home mode, you will need to Access The Programming (pg. 6). The code is 751019 which means that there are 6 different features that you can program. Go through all the steps and change the numbers as they suit you. When you get to the last digit, there are no instructions written in the book, so you will have to figure this out on your own. If the last digit is 1, change it to 0 or 9.4.) After going through the programming and changing the last number, you should be able to go back to change the personal code in home mode.5.) If you set your password and it doesnt lock, go back to the programming again, and change the last digit back to what it was originally.Good luck.');
