INSERT INTO review VALUES(2759, 447, 5, 'Chocolate didnt melt in transit to Bhubaneswar( doesnt melt in transit to Bengaluru either).I love dark chocolate and can eat comfortably till Amul 90%, so wanted to try the ultimate 99% but found it a little too bitter for my taste so now I use it to make hot chocolate and it tastes much better than Hersheys. Just chop this chocolate into small pieces and stir it in your milk!');
