INSERT INTO review VALUES(2760, 403, 5, 'Initially I thought this face wash is waste of money as it doesnt lather at all but used it for a month anyways. I have started noticing a lot of difference in my skin. This made my skin very soft n all the dry patches I had on my face have reduced as this doesnt dry your skin rather hydrate your skin along with cleaning it... Best face wash for people with sensitive n dry skin.');
INSERT INTO continutvanzare VALUES(2760, 480, 166622, 9);
INSERT INTO review VALUES(2760, 480, 5, 'Had tried this product majorly because of the name and ingredients that it has. For the first time a company is able to get the product that is based on our ancient secret recipes of our Dadi Nani... a person like me who has super dry skin, this is the perfect product for me as it hydrates my skin thoroughly and gives an instant freshness like the way ubtan gives. Very good for my super dry  super sensitive skin. Loved this product. Kudos mamaearth for this amazing thought behind this product .');
