INSERT INTO review VALUES(2877, 217, 5, 'I really had liked the packing of this soap. But more than that, I remember as soon as I had unpacked it, the surprising fresh smell coming from it was amazing.The soap foam feels soft, rich and white. It moisturizes the skin perfectly. I have an oily skin so I wanted a soap which can balance the skin moisture, not over moisturizing not drying out the skin. And this soap pretty much does that.Also, it lasts for a good time, also most soaps give up their foaming capability as soon as they become small, but this one still gives great lather. Would recommend to everyone.');
