INSERT INTO continutvanzare VALUES(2931, 284, 664445, 4);
INSERT INTO review VALUES(2931, 284, 5, 'If you really a teas fan, you definitely not being unaware of the TATA Tea family. Trusted brand from so many years. I tried almost every standard brand of Teas available in the market, but at last I can say that TATA Tea is the best available brand in the printed price. Although TATA Tea brand is already quite efficient in serving the purpose but the current addition of TATA Tea Gold actually makes sense because of the quality enhancement by adding dried whole tea leaves in to the processed tea. Mixing of whole leaf resulted into the enhanced flavor  color of the prepared Tea. Not more concentrated not milder, it’s like a balanced golden color with real taste/flavor which designed exactly keeping in mind the expectation of the user.1. I agree that if you require strong color/flavor you need to add a little more leaves in to the preparation because TATA Tea Gold is not meant for people who like very strong color seekers. Its more workable for people who wants real flavor with natural golden color in the final preparation. Although even a single tea-spoon is enough to prepare a natural golden cup full of real tea.2. One may keep in mind before using that this tea contains real whole dry tea leaves, so it may take more 2 minutes in preparation in comparison with other brands and the reason is, it is without any added artificial colors into it. The whole dried tea leaves takes time to release real flavor of the contents.3. Taste is premium  up to the expectations as always.4. Packaging is good enough. Visual ergonomic principles well taken into consideration designing the same. Its smarter and visually appealing than the previous packs.I’m using this product from more than 2 years. So, its not an random review. In my family we are using this product in making of every single cup day and night 24x7, whenver we feel like to have one.');
